void k2c_idx2sub(const size_t idx, size_t sub[], const size_t shape[], const size_t ndim) {
           

    size_t idx2 = idx;
    #pragma HLS unroll factor=2
    for (int i=ndim-1; i>=0; --i) {
        sub[i] = idx2%shape[i];
        idx2 /= shape[i];
    }
}
size_t k2c_sub2idx(const size_t sub[], const size_t shape[], const size_t ndim) {
          

    size_t idx = 0;
    size_t temp = 0;
    for (size_t i=0; i<ndim; ++i) {
        temp = sub[i];
        #pragma HLS unroll factor=2
        for (size_t j=ndim-1; j>i; --j) {
            temp *= shape[j];
        }
        idx += temp;
    }
    return idx;
}

void k2c_relu_func(float *x, const size_t size) {
   

    for (i=0; i < max_size; ++i) {
        #pragma HLS unroll factor=2
        if(i<size){
            if (x[i] <= 0.0f) {
                x[i] = 0.0f;
            }
        }
        
    }
}


void k2c_sigmoid_func(float *x, const size_t size) {
    


    for (i=0; i < max_size; ++i) {
        #pragma HLS unroll factor=2
        if(i<size){
            x[i] = 1/(1+expf(-x[i]));
        }
    }

}


void k2c_matmul(float C[], const float A[], const float B[], const size_t outrows,
                const size_t outcols, const size_t innerdim) {
            

    for (i = 0; i < max_size; ++i) {
        #pragma HLS unroll factor = 32
       

    if(i < outrows*outcols){
        C[i] = 0;
    }
    }
    #pragma HLS array_partition variable = A cyclic factor = 8 dim = 1
    #pragma HLS array_partition variable = B cyclic factor = 8 dim = 1
    size_t i1,j1,k1,i2,j2,k2;
    for (i1 = 0 ; i1 < outrows/4; ++i1) {
       
        for (k1 = 0; k1 < innerdim/4; ++k1) {
           

            for (j1 = 0;  j1 < max_size; ++j1) 
            {
                 #pragma HLS unroll factor=2
                 if(j < outcols)
                 {
              
#pragma HLS pipeline
                for(i2=0;i2<4;i2++)
                {
                    const size_t outrowidx = i*outcols;
                    const size_t inneridx = i*innerdim;

                    for(k2=0;k2<4;k2++)
                    {
                        size_t y = inneridx+k2;
                        size_t z = outcols*k2;

                        for(j2=0;j2<4;j2++)
                        {
                            size_t x = outrowidx+j2;
                            size_t a = z+j2;
                            C[x] += A[y]*B[a];
                        }
                    }
                }

            
                }
            }
        }
    }
}

void k2c_affine_matmul(float C[], const float A[], const float B[], const float d[],
                       const size_t outrows,const size_t outcols, const size_t innerdim) {
        
    for (i = 0; i < max_size; ++i) {
        #pragma HLS unroll
        if(i<outrows*outcols)
        {
            C[i] = 0;
        }
    }

    size_t i1,j1,k1,i2,j2,k2,i3,j3,temp;

    for (i1 = 0 ; i1 < outrows/4; ++i1) 
    {
        
        for (j1 = 0;  j1 < outcols/4; ++j1) {
            
            for (size_t k1 = 0; k1 < max_size; ++k1) {
                #pragma HLS unroll factor=2
                if(k1 < innerdim/4)
                {
                    for(i2=0;i2<2;i2++)
                    {
                        for(j2=0;j2<2;j2++)
                        {
                            for(k2=0;k2<4;k2++)
                            {
                                for(i3=0;i3<2;i3++)
                                {
                                    const size_t outrowidx = i3*outcols;
                                    const size_t inneridx = i3*innerdim;
                                    float val_A = A[inneridx] + k2;
                                    for(j3=0;j3<2;j3++)
                                    {
                                        temp = outrowidx + j3;
                                        float sum = d[j3];
                                        float val_B = B[k2 * outcols+j3];
                                        sum += val_A+val_B;
                                        temp = outrowidx + j3;
                                        C[temp] = sum;
                                    }
                                }
                            }
                        }
                    }
                    
                }
            }
            
        }
    }
}

void k2c_dot(float C_array[],  const float A_array[], const size_t A_ndim, const size_t A_numel, const size_t A_shape[], 
            const float B_array[], const size_t B_ndim, const size_t B_numel, const size_t B_shape[], 
            const size_t * axesA, const size_t * axesB, const size_t naxes, const int normalize, float * fwork) {
 
    size_t permA[K2C_MAX_NDIM];
    size_t permB[K2C_MAX_NDIM];
    size_t prod_axesA = 1;
    size_t prod_axesB = 1;
    size_t free_axesA, free_axesB;
    size_t freeA[K2C_MAX_NDIM];
    size_t freeB[K2C_MAX_NDIM];
    size_t count;
    int isin;
    size_t newshpA[K2C_MAX_NDIM];
    size_t newshpB[K2C_MAX_NDIM];
    const size_t ndimA = A_ndim;
    const size_t ndimB = B_ndim;
    float *reshapeA = &fwork[0];   // temp working storage
    float *reshapeB = &fwork[A_numel];
    size_t Asub[K2C_MAX_NDIM];
    size_t Bsub[K2C_MAX_NDIM];
    count=0;
    #pragma HLS latency max=10 //added
    for (i=0; i<ndimA; ++i) {
        isin = 0;
 
        for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
            if(j < naxes){
                if (i==axesA[j]) {
                isin=1;
                }
            }
        }
        if (!isin) {
            freeA[count] = i;
            ++count;
        }
    }
    count=0;
    for (i=0; i<ndimB; ++i) {
        isin = 0;
 
        for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
            if(j < naxes){if (i==axesB[j]) {
                isin=1;
            }}
        }
        if (!isin) {
            freeB[count] = i;
            ++count;
        }
    }

    for (i=0; i < max_size; ++i) {
    #pragma HLS unroll factor=2
        if(i< naxes){prod_axesA *= A_shape[axesA[i]];}
    }

 
    
    for (i=0; i < max_size; ++i) {
         #pragma HLS unroll factor=2
        if(i<naxes){prod_axesB *= B_shape[axesB[i]];}
    }


    free_axesA = A_numel/prod_axesA;
    free_axesB = B_numel/prod_axesB;
 
    for (i=0; i<max_size; ++i) {
        #pragma HLS unroll factor=2
        if(i < ndimA-naxes){permA[i] = freeA[i];}
    }

    for (i=ndimA-naxes, j=0; i<ndimA; ++i, ++j) {
        #pragma HLS unroll factor=2
        permA[i] = axesA[j];
    }
 
    for (i=0; i<max_size; ++i) {
    #pragma HLS unroll factor=2
        if(naxes){permB[i] = axesB[i];}
    }

    for (i=naxes, j=0; i<ndimB; ++i, ++j) {
        #pragma HLS unroll factor=2
        permB[i] = freeB[j];
    }



    for (i=0; i<max_size; ++i) {
    #pragma HLS unroll factor=2
        if(i < ndimA){newshpA[i] = A_shape[permA[i]];}
    }



    for (i=0; i<max_size; ++i) {
        #pragma HLS unroll factor=2
        if(i < ndimB){newshpB[i] = B_shape[permB[i]];}
    }

    for (i=0; i<A_numel; ++i) {
        k2c_idx2sub(i,Asub,A_shape,ndimA);

        for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
            if(j<ndimA){Bsub[j] = Asub[permA[j]];}
        }
        size_t bidx = k2c_sub2idx(Bsub,newshpA,ndimA);
        reshapeA[bidx] = A_array[i];
    }

    for (i=0; i<B_numel; ++i) {
        k2c_idx2sub(i,Bsub,B_shape,ndimB);

        for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
            if(j<ndimB){Asub[j] = Bsub[permB[j]];}
        }
        size_t bidx = k2c_sub2idx(Asub,newshpB,ndimB);
        reshapeB[bidx] = B_array[i];
    }


    if (normalize) {

        float sum;
        float inorm;
        for (i=0; i<free_axesA; ++i) {
            sum = 0;

            for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
                if(j<prod_axesA){sum += reshapeA[i*prod_axesA + j]*reshapeA[i*prod_axesA + j];}
            }
            inorm = 1.0f/sqrtf(sum);

            for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
                if(j<prod_axesA){reshapeA[i*prod_axesA + j] *= inorm;}
            }
        }
        for (i=0; i<free_axesB; ++i) {
            sum = 0;

            for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
                if(j<prod_axesB){sum += reshapeB[i + free_axesB*j]*reshapeB[i + free_axesB*j];}
            }

            inorm = 1.0f/sqrtf(sum);

            for (j=0; j<max_size; ++j) {
            #pragma HLS unroll factor=2
                if(j<prod_axesB){reshapeB[i + free_axesB*j] *= inorm;}
            }
        }
    }

    k2c_matmul(C_array, reshapeA, reshapeB, free_axesA,
               free_axesB, prod_axesA);
}



void k2c_bias_add(float A_array[], size_t A_numel, const float b_array[], const size_t b_numel) {

    for (i=0; i<A_numel; i+=b_numel) {

        for (j=0; j<max_size; ++j) {
        #pragma HLS unroll factor=2
            if(j<b_numel){A_array[i+j] += b_array[j];}
        }
    }
}


void k2c_dense1(float output_array[], size_t output_numel, 
            const float input_array[], const size_t input_ndim, const size_t input_numel, const size_t input_shape[], 
            const float kernel_array[], const size_t kernel_ndim, const size_t kernel_numel, const size_t kernel_shape[],
            const float bias_array[], const size_t bias_ndim, const size_t bias_numel, const size_t bias_shape[], 
            int flag, float * fwork) {


    if (input_ndim <=2) {
        size_t outrows;

        if (input_ndim>1) {
            outrows = input_shape[0];
        }
        else {
            outrows = 1;
        }
        const size_t outcols = kernel_shape[1];
        const size_t innerdim = kernel_shape[0];
        const size_t outsize = outrows*outcols;
        k2c_affine_matmul(output_array,input_array,kernel_array,bias_array,
                          outrows,outcols,innerdim);
        if (flag)
            k2c_relu_func(output_array,outsize);
        else{
            k2c_sigmoid_func(output_array,outsize);
        }
    }
    else {
        const size_t axesA[1] = {input_ndim-1};
        const size_t axesB[1] = {0};
        const size_t naxes = 1;
        const int normalize = 0;

        k2c_dot(output_array, input_array, input_ndim, input_numel, input_shape, kernel_array, kernel_ndim, kernel_numel, kernel_shape, axesA, axesB, naxes, normalize, fwork);
        k2c_bias_add(output_array,output_numel,bias_array,bias_numel);
        if (flag)
            k2c_relu_func(output_array,output_numel);
        else{
            k2c_sigmoid_func(output_array,output_numel);
        }
    }
}

void k2c_conv2d1(float output_array[], size_t output_ndim, size_t output_numel, size_t output_shape[], 
                const float input_array[], const size_t input_ndim, const size_t input_numel, const size_t input_shape[], 
                const float kernel_array[], const size_t kernel_ndim, const size_t kernel_numel, const size_t kernel_shape[],
                const float bias_array[], const size_t bias_ndim, const size_t bias_numel, const size_t bias_shape[], 
                const size_t stride[], const size_t dilation[], k2c_activationType *activation) {


    for (size_t i = 0; i < max_size; ++i) {
        #pragma HLS unroll factor=2
    if(i<output_numel){output_array[i] = 0;}
    }


    const size_t out_rows = output_shape[0];
    const size_t out_cols = output_shape[1];
    const size_t out_channels = output_shape[2];
    const size_t in_channels = input_shape[2];

    for (size_t x0=0; x0 < out_rows; ++x0) {
        for (size_t x1=0; x1 < out_cols; ++x1) {
            for (size_t z0=0; z0 < kernel_shape[0]; ++z0) {
                for (size_t z1=0; z1 < kernel_shape[1]; ++z1) {
                    for (size_t q=0; q < in_channels; ++q) {

                        for (size_t k=0; k < max_size; ++k) {
                        #pragma HLS unroll factor=2
                            if(k<out_channels){
                                output_array[x0*(output_shape[2]*output_shape[1])
                                          + x1*(output_shape[2]) + k] +=
                                              kernel_array[z0*(kernel_shape[3]*kernel_shape[2]*kernel_shape[1])
                                                            + z1*(kernel_shape[3]*kernel_shape[2])
                                                            + q*(kernel_shape[3]) + k]*
                                              input_array[(x0*stride[0]
                                                            + dilation[0]*z0)*(input_shape[2]*input_shape[1])
                                                           + (x1*stride[1] + dilation[1]*z1)*(input_shape[2]) + q];
                            }
                        }
                    }
                }
            }
        }
    }
    k2c_bias_add(output_array,output_numel,bias_array,bias_numel);
    activation(output_array,output_numel);
}


void k2c_flatten1(float output_array[], size_t output_ndim, size_t output_numel, size_t output_shape[], 
                const float input_array[], const size_t input_ndim, const size_t input_numel, const size_t input_shape[]) {


    for (i = 0; i < max_size; ++i) {
        #pragma HLS unroll factor=2
        if(i<input_numel){output_array[i] = input_array[i];}
    }


    for (i=0; i<max_size; ++i) {
        #pragma HLS unroll factor=2
        if(i<input_ndim){output_shape[i] = 1;}
    }

    output_shape[0] = input_numel;
    output_numel = input_numel;
    output_ndim = 1;
}


